import axios from "axios";
import { useState } from "react";

function StudentList(){
const [students,setStudents] = useState([]);
axios.get('http://127.0.0.1:8000/api/student-index')
.then(res =>{
    setStudents(res.data)
})
// const students.map((item,key)=>{
